exports=async function(bid,options){const{parseUpdate}=await require("transcode/parse_update");return parseUpdate(`https://www.daoyouge.net/${bid}/`,/ul>\s*<li><a[^>]+>(?<name>[^<]+) (?<updateTime>\d{4}-\d{2}-\d{2} \d{2}:\d{2}:\d{2})</,{clientOptions:{...(options&&options.clientOptions),"x-mobile":0}})};